// SPDX-License-Identifier: MIT
pragma solidity 0.8.0;

contract MyToken {
    string public name; // Name of the token
    string public symbol; // Symbol of the token
    uint256 public totalSupply; // Total supply of the token
    mapping (address => uint256) public balances; // Mapping of addresses to token balances

    constructor(string memory _name, string memory _symbol, uint256 _totalSupply) {
        name = _name;
        symbol = _symbol;
        totalSupply = _totalSupply;
        balances[msg.sender] = _totalSupply; // Set the initial balance of the contract deployer to the total supply
    }

    function mint(address _to, uint256 _value) public {
        require(_to != address(0), "Invalid address"); // Require a valid address to mint tokens to
        totalSupply += _value; // Increase the total supply by the given value
        balances[_to] += _value; // Increase the balance of the recipient by the given value
    }

    function burn(address _from, uint256 _value) public {
        require(_from != address(0), "Invalid address"); // Require a valid address to burn tokens from
        require(balances[_from] >= _value, "Insufficient balance"); // Require that the balance of the address is sufficient to burn the given value
        totalSupply -= _value; // Decrease the total supply by the given value
        balances[_from] -= _value; // Decrease the balance of the address by the given value
    }
}

